import React, { Component } from 'react';

class App extends Component {
  render() {
    return (
      <div className="row">
        <h2 className="text-black text-center section_title loop_title ">
          Все жилые комплексы
          <span className="bold">«СК БУДОВА»</span>
        </h2>
      </div>
    );
  }
}

export default App;
